/* Default styles */
.container {
    display: flex;
    justify-content: center;
    align-items: center;
    /* height: 80vh; */
  }
  
  .video-window {
    width: 1280px;
    height: 650px;
    border: 2px dashed #ccc;
    border-radius: 10px;
    overflow: hidden;
    display: flex;
    flex-direction: column;
    padding: 10px;
  }
  
  .chat-body {
    flex: 1;
    padding: 10px;
    overflow-y: hidden;
  }
  
  .message-list {
    list-style-type: none;
    padding: 0;
    margin: 0;
  }
  
  .message {
    margin-bottom: 10px;
    padding: 10px;
    border-radius: 10px;
    max-width: 80%;
    color: #fff;
  }
  
  .message.received {
    background-color: #a6bddb;
    align-self: flex-start;
    list-style-type: none; /* Add this line to remove bullet points */
  }
  
  
  .message.sent {
    background-color: #3c7b8e;
    align-self: flex-end;
    width: fit-content;
    padding: 10px;
    margin-left: auto;
    margin-right: 10px;
    border-radius: 10px;
    box-sizing: border-box;
  }
  
  .message-sender {
    font-weight: bold;
    margin-right: 10px;
  }
  
  .chat-footer {
    display: flex;
    align-items: center;
    padding: 10px;
  }
  
  .message-input {
    flex: 1;
    padding: 10px;
    border: 1px solid #ccc;
    border-radius: 5px;
    width: 100%;
    box-sizing: border-box;
  }
  
  .send-button {
    margin-left: 10px;
    padding: 10px;
    border: none;
    border-radius: 5px;
    background-color: #3c7b8e;
    color: #fff;
    font-weight: bold;
  }
  
  /* Mobile styles */
  @media only screen and (max-width: 600px) {
    .container {
      padding: 10px;
    }
  
    .chat-window {
      width: 100%;
      height: 100%;
      border: none;
      border-radius: 0;
    }
  
    .chat-body {
      padding: 0;
    }
  
    .message-list {
      padding: 10px;
    }
  
    .chat-footer {
      padding: 0;
      flex-direction: column;
    }
  
    .message-input {
      flex: 1;
      margin-top: 10px;
      margin-bottom: 10px;
      border-radius: 0;
      width: 100%;
    }
  
    .send-button {
      margin-left: 0;
      margin-top: 10px;
      border-radius: 0;
      width: 100%;
    }
  }
  
  figure {
    max-width: 64rem;
    width: 100%;
    max-height: 30.875rem;
    height: 100%;
    margin: 1.25rem auto;
    padding: 1.051%;
    background-color: #666;
  }
  .controls {
    width: 100%;
    height: 8.0971659919028340080971659919028%; /* of figure's height */
    position: relative;
  }
  .controls[data-state="hidden"] {
    display: none;
  }
  
  .controls[data-state="visible"] {
    display: block;
  }
  .controls > * {
    float: left;
    width: 3.90625%;
    height: 100%;
    margin-left: 0.1953125%;
    display: block;
  }
  
  .controls > *:first-child {
    margin-left: 0;
  }
  .controls .progress {
    cursor: pointer;
    width: 75.390625%;
  }
  .controls button {
    border: none;
    cursor: pointer;
    background: transparent;
    background-size: contain;
    background-repeat: no-repeat;
  }
  .controls button:hover,
  .controls button:focus {
    opacity: 0.5;
  }
  .controls button[data-state="play"] {
    background-image: url("data:image/png;base64,iVBORw0KGgoAAA…");
  }
  
  .controls button[data-state="pause"] {
    background-image: url("data:image/png;base64,iVBORw0KGgoAAA…");
  }
  .controls progress {
    display: block;
    width: 100%;
    height: 81%;
    margin-top: 0.125rem;
    border: none;
    color: #0095dd;
    -moz-border-radius: 2px;
    -webkit-border-radius: 2px;
    border-radius: 2px;
  }
  .controls progress[data-state="fake"] {
    background: #e6e6e6;
    height: 65%;
  }
  .controls progress span {
    width: 0%;
    height: 100%;
    display: inline-block;
    background-color: #2a84cd;
  }
  .controls progress::-moz-progress-bar {
    background-color: #0095dd;
  }
  
  .controls progress::-webkit-progress-value {
    background-color: #0095dd;
  }

